const baseUrl = "https://cnes2.datasus.gov.br/";

// Pega o item corretamente (lista ou único objeto)
const item = Array.isArray(items) ? items[0] : items;
const html = item.json.data || item.json || "";

const rowRegex = /<tr[^>]*bgcolor=['"]#cccccc['"][^>]*>(.*?)<\/tr>/gis;
const tdRegex = /<td[^>]*>(.*?)<\/td>/gis;
const linkRegex = /<a[^>]*href=['"]([^'"]+)['"][^>]*>(.*?)<\/a>/i;

const resultados = [];

let match;
while ((match = rowRegex.exec(html)) !== null) {
  const rowHtml = match[1];
  const cols = [...rowHtml.matchAll(tdRegex)].map(m => m[1]);

  if (cols.length >= 4) {
    const linkMatch = cols[1].match(linkRegex);
    if (!linkMatch) continue;

    const linkHref = linkMatch[1].trim();
    const nome = linkMatch[2].replace(/<[^>]*>/g, "").trim();

    let link = linkHref;
    if (link && !link.startsWith("http")) {
      link = baseUrl + link.replace(/^\//, "");
    }

    const existentes = cols[2].replace(/<[^>]*>/g, "").trim();
    const emUso = cols[3].replace(/<[^>]*>/g, "").trim();

    resultados.push({
      Estabelecimento: nome,
      Link: link,
      Existentes: existentes,
      Em_Uso: emUso,
    });
  }
}

// Adiciona o número do lote (1 ou 2)
const total = resultados.length;
const metade = Math.ceil(total / 2);

const final = resultados.map((r, i) => ({
  json: {
    ...r,
    Lote: i < metade ? 1 : 2
  }
}));

return final;

